<template>
    <v-parallax dark src="https://cdn.vuetifyjs.com/images/backgrounds/vbanner.jpg" height="600">
         <v-layout class="mt-5">
            <v-flex xs10 offset-xs4>
                <v-card max-width="400">
                    <v-card-title class="headline">
                        Sales Report
                    </v-card-title>
                    <v-divider></v-divider>
                    <v-card-text>
                        A sales report, or sales analysis report, gives an overview of the state of the sales activities within a Smart Dustbin Shop.
                        <br>
                        Print your PDF Sales Report
                    </v-card-text>
                    <v-img src="https://ucgeek.co/wp-content/uploads/2022/10/Report.png" class="ml-10 mr-5" max-width="300" max-height="300"></v-img>
                    <v-card-actions>
                        <v-spacer></v-spacer>
                        <v-btn color="red" class="mt-5 mr-5 mb-3" rounded block @click="createPDF()">
                            Print Report
                        </v-btn>
                    </v-card-actions>
                </v-card>
            </v-flex>
        </v-layout>
    </v-parallax>
</template>
<script>
import jsPDF from 'jspdf';
  export default {
    data () {
      return {
         dataSales: [],
         nama: '',
         jlh: 0,
         customer: 0,
         total: 0,
         tgl: new Date().toLocaleString(),
      }
    },
    methods: {
        getPenjualan(){
            var uri = this.$apiUrl + '/order/penjualan'
            this.$http.get(uri).then( (response) =>{
                this.dataSales=response.data[0]
                this.nama=response.data[0].Produk
                this.total=response.data[0].total
                this.jlh=response.data[0].Quantity
            })
        },
        getJumlahCustomer(){
            var uri = this.$apiUrl + '/order/customer'
            this.$http.get(uri).then( (response) =>{
                this.customer=response.data
                console.log(this.customer)
            })
        },
        convert(){
            var x  = new Date(this.tgl);
            var dd = x.getDate();
            var mm = x.getMonth()+1;
            var yy = x.getFullYear();
            if(mm==1){
                mm="January"
            }else if(mm==2){
                mm="February"
            }else if(mm==3){
                mm="March"
            }else if(mm==4){
                mm="April"
            }else if(mm==5){
                mm="May"
            }else if(mm==6){
                mm="Juni"
            }else if(mm==7){
                mm="July"
            }else if(mm==8){
                mm="Agustus"
            }else if(mm==9){
                mm="September"
            }else if(mm==10){
                mm="Oktober"
            }else if(mm==11){
                mm="November"
            }else if(mm==12){
                mm="Desember"
            }
            this.tgl = dd + " " + mm + " " + yy
            console.log(this.tgl)
        },
        rubah(angka){
            var reverse = angka.toString().split('').reverse().join(''),
            ribuan = reverse.match(/\d{1,3}/g);
            ribuan = ribuan.join('.').split('').reverse().join('');
            return ribuan;
        },
        createPDF () {
        let pdfName = "Sales Report Smart Dustbin"; 
        var doc = new jsPDF('2', 'pt', 'a5', true);
        var img = 'data:image/png;base64,'
        doc.addImage(img, "JPEG", 110, 10, 200, 150);
        
        doc.setFontSize(22)
        doc.setTextColor(0, 0, 255);
        doc.text(75, 180, 'SMART DUSTBIN SHOP')
        doc.setFontSize(16)
        doc.text(160, 200, 'Sales Report')
        doc.setTextColor("black");
        // urutan line(padding, titik awal garis, panjang, titik akhir)
        doc.setLineWidth(0.5);
        doc.line(60, 210, 350, 210);
        doc.setFontSize(11)
        doc.text(60, 235, 'Date : '+this.tgl)
        doc.setFontSize(10)
        doc.text(60, 270, 'Total Customer That Order in Smart Dustbin Shop :' )
        doc.setTextColor("red");
        doc.setFont("helvetica");
        doc.setFontStyle("bold");
        doc.setFontSize(20)
        doc.text(80, 295, this.customer.toString())
        doc.setFontStyle("normal");
        doc.setTextColor("black");
        doc.setFontSize(10)
        doc.text(60, 320, 'Most product sales :')
        doc.setTextColor("red");
        doc.setFont("helvetica");
        doc.setFontStyle("bold");
        doc.setFontSize(18)
        doc.text(80, 345, this.nama.toString()+' - ( '+this.jlh.toString()+' )')
        doc.setFontStyle("normal");
        doc.setTextColor("black");
        doc.setFontSize(10)
        doc.text(60, 370, 'Total sales :')
        var total = this.rubah(this.total)
        doc.setTextColor("red");
        doc.setFont("helvetica");
        doc.setFontStyle("bold");
        doc.setFontSize(18)
        doc.text(80, 395, "Rp."+total.toString()+",-")
        doc.setFontStyle("normal");
        doc.setTextColor("black");
        doc.setLineWidth(0.5);
        doc.line(60, 430, 350, 430);

        doc.setProperties({
            title: "Sales Report Smart Dustbin Shop"
        });
        var string = doc.output('dataurlnewwindow');
        var embed = "<embed width='100%' height='100%' src='" + string + "'/>"
        var x = window.open();
        x.document.open();
        x.document.write(embed);
        x.document.close();

    },
    },
    mounted(){
       this.getPenjualan();
       this.getJumlahCustomer();
       this.convert();
    }
  }
</script>